import React, {useEffect, useState} from "react";
import { Link } from "react-router-dom";

function Events() {
    const [items, setItems] = useState([]);

    useEffect(() => {
        fetch('/events')
            .then(res => {
                return res.json()
            })
            .then(data => {
                console.log(data)
            })
            .catch(err=> console.log(err));
    }, []);

    return (
        <section>
            {
                items.map(item => {
                    <div>
                        <p>{item.name}</p>
                        <p>{item.msg}</p>
                        <p>{item.username}</p>
                    </div>
                })
            }
        </section>
    );
}

export default Events;
